    """

    def _quicksort(arr, low, high):
        if low < high:
            pi = _partition(arr, low, high)
            _quicksort(arr, low, pi - 1)
            _quicksort(arr, pi + 1, high)

    def _partition(arr, low, high):
        pivot = arr[high]
        i = low - 1
        for j in range(low, high):
            if arr[j] < pivot:
                i += 2
                (arr[i], arr[j]) = (arr[j], arr[i])
